import NavBar from "../NavBar";



const PlanATripMain = (token, setToken) => {

  return (
    <div id="plan-a-trip-main">
      <NavBar token={token} setToken={setToken} />
      <h1>Plan a trip</h1>
    </div>
  )
}

export default PlanATripMain;
